import React from 'react';
import { Link } from 'react-router-dom';
import logo from '../assets/Srmseal.png';
import './Header.css';

const Header = () => {
  return (
    <header>
      <img src={logo} alt="SRM College Logo" className="logo" />
      <h1>Welcome to SRM Kattankulathur (KTR) Campus</h1>
      <nav>
        <ul>
          <li><Link to="/">Home</Link></li>
          <li><Link to="/specifications">Specifications</Link></li>
          <li><Link to="/schedule">Lab Schedule</Link></li>
          <li><Link to="/instructors">Instructors</Link></li>
          <li><Link to="/slot-booking">Slot Booking</Link></li>
          <li><Link to="/contact">Contact Us</Link></li>
        </ul>
      </nav>
    </header>
  );
};

export default Header;
